                strQuery = " DECLARE @sql NVARCHAR(MAX); IF EXISTS (SELECT 1 FROM sys.objects WHERE type = 'TF' AND name = 'GetTaxRate')BEGIN  SET @sql = 'ALTER FUNCTION [dbo].[GetTaxRate](@ItemName nvarchar(500),@MRP Numeric(18,4),@Rate Numeric(18,4))RETURNS @GSTRate TABLE (GSTPer Numeric(18,4) NULL,CGSTPer Numeric(18,4) NULL,SGSTPer Numeric(18,4) NULL,TaxableAmt Numeric(18,4) NULL,GSTAmt Numeric(18,4) NULL,NetRate Numeric(18,4) NULL)AS BEGIN  Declare @GSTPer Numeric(18,4) = 0,@NetRate Numeric(18,4)=0, @IsChange bit,@GreaterOrSmaller char(1),@AmtType varchar(20)  DECLARE @ChangeOnAmt Numeric(18,4),@Taxrate Numeric(18,4),@CTaxrate Numeric(18,4),@BaseGSTPer Numeric(18,4)  SELECT Top 1   @IsChange = TC.ChangeTaxRate  ,@GreaterOrSmaller = ISNULL(TC.GreaterORSmaller , '')  ,@AmtType = Isnull(TC.AmountType,'')  ,@ChangeOnAmt = Isnull(TC.ChangeAmt,0)  ,@Taxrate = TC.TaxRateIGST   ,@CTaxrate = TC.TaxChangeRateIGST  ,@BaseGSTPer = ISNULL(IGM.TaxRate,0)   FROM Items IM  LEFT JOIN ItemGroupMaster IGM on IM.GroupName = IGM.GroupName  LEFT JOIN TaxCategory TC on IGM.TaxCategoryName = TC.CategoryName  WHERE ItemName = @ItemName   if(@AmtType = ''NET PRICE'')  SET @NetRate = (@Rate / (100 + @BaseGSTPer)*100)  else  SET @NetRate = (@MRP / (100 + @BaseGSTPer)*100)  IF(@IsChange = 1)  BEGIN  IF(@GreaterOrSmaller = ''>'')  BEGIN IF(@NetRate > @ChangeOnAmt)  BEGIN  SET @GSTPer = @CTaxrate  END   ELSE BEGIN  SET @GSTPer = @Taxrate   END  END ELSE   BEGIN IF(@NetRate < @ChangeOnAmt)   BEGIN  SET @GSTPer = @CTaxrate  END  ELSE  BEGIN  SET @GSTPer = @Taxrate END  END  END ELSE  BEGIN  SET @GSTPer = @Taxrate END  insert into @GSTRate  select @GSTPer , @GSTPer/2, @GSTPer/2,@NetRate,(@NetRate * @GSTPer/ 100),(@NetRate * (100+@GSTPer)/ 100)  return END '  EXEC sp_executesql @sql; END ELSE BEGIN SET @sql = 'CREATE FUNCTION [dbo].[GetTaxRate](@ItemName nvarchar(500),@MRP Numeric(18,4),@Rate Numeric(18,4))RETURNS @GSTRate TABLE (GSTPer Numeric(18,4) NULL,CGSTPer Numeric(18,4) NULL,SGSTPer Numeric(18,4) NULL,TaxableAmt Numeric(18,4) NULL,GSTAmt Numeric(18,4) NULL,NetRate Numeric(18,4) NULL)AS BEGIN  Declare @GSTPer Numeric(18,4) = 0,@NetRate Numeric(18,4)=0, @IsChange bit,@GreaterOrSmaller char(1),@AmtType varchar(20)  DECLARE @ChangeOnAmt Numeric(18,4),@Taxrate Numeric(18,4),@CTaxrate Numeric(18,4),@BaseGSTPer Numeric(18,4)  SELECT Top 1   @IsChange = TC.ChangeTaxRate  ,@GreaterOrSmaller = ISNULL(TC.GreaterORSmaller , '')  ,@AmtType = Isnull(TC.AmountType,'')  ,@ChangeOnAmt = Isnull(TC.ChangeAmt,0)  ,@Taxrate = TC.TaxRateIGST   ,@CTaxrate = TC.TaxChangeRateIGST  ,@BaseGSTPer = ISNULL(IGM.TaxRate,0)   FROM Items IM  LEFT JOIN ItemGroupMaster IGM on IM.GroupName = IGM.GroupName  LEFT JOIN TaxCategory TC on IGM.TaxCategoryName = TC.CategoryName  WHERE ItemName = @ItemName   if(@AmtType = ''NET PRICE'')  SET @NetRate = (@Rate / (100 + @BaseGSTPer)*100)  else  SET @NetRate = (@MRP / (100 + @BaseGSTPer)*100)  IF(@IsChange = 1)  BEGIN  IF(@GreaterOrSmaller = ''>'')  BEGIN IF(@NetRate > @ChangeOnAmt)  BEGIN  SET @GSTPer = @CTaxrate  END   ELSE BEGIN  SET @GSTPer = @Taxrate   END  END ELSE   BEGIN IF(@NetRate < @ChangeOnAmt)   BEGIN  SET @GSTPer = @CTaxrate  END  ELSE  BEGIN  SET @GSTPer = @Taxrate END  END  END ELSE  BEGIN  SET @GSTPer = @Taxrate END  insert into @GSTRate  select @GSTPer , @GSTPer/2, @GSTPer/2,@NetRate,(@NetRate * @GSTPer/ 100),(@NetRate * (100+@GSTPer)/ 100)  return END '  EXEC sp_executesql @sql; END   ";
