                strQuery = " DECLARE @SQL VARCHAR(MAX)='' IF NOT EXISTS (SELECT * FROM sys.objects WHERE [name] = N'TR_InOutItemStock' AND [type] = 'TR') BEGIN  SET @SQL = 'CREATE TRIGGER TR_InOutItemStock ON dbo.StockMaster AFTER INSERT, DELETE AS BEGIN SET NOCOUNT ON; END' 	EXEC (@SQL) END;  SET @SQL = ' ALTER TRIGGER [dbo].[TR_InOutItemStock] ON [dbo].[StockMaster] AFTER INSERT, DELETE AS BEGIN SET NOCOUNT ON; IF EXISTS (SELECT * FROM inserted)  BEGIN  SET NOCOUNT ON UPDATE ST SET ST.StockQty = ISNULL(ST.StockQty,0)+ISNULL(Ins.Qty,0),ST.SaleRate = isnull(SR.SaleRate,0),ST.AvgRate = 0,Date=GETDATE() FROM (SELECT I.ItemName,ISNULL(I.Barcode,'''') Barcode,ISNULL(I.BrandName,'''') BrandName,I.Variant1,I.Variant2,Qty=(CASE WHEN MAX(I.BillType) IN (''OPENING'',''PURCHASE'',''STOCKIN'',''SALERETURN'') then SUM(I.Qty) WHEN MAX(I.BillType) IN (''SALES'', ''PURCHASERETURN'', ''STOCKOUT'') then -SUM(I.Qty) else 0 end) FROM inserted I  GROUP BY I.ItemName,I.BarCode,I.BrandName,I.Variant1,I.Variant2 ) Ins LEFT JOIN ItemStock ST ON ST.ItemName = Ins.ItemName AND ST.BarCode = Ins.BarCode AND ST.BrandName = Ins.BrandName AND ST.Variant1 = Ins.Variant1 AND ST.Variant2 = Ins.Variant2 LEFT JOIN ( SELECT * FROM ( Select ItemName,BarCode,BrandName,Variant1,Variant2,SaleRate,ROW_NUMBER() OVER (PARTITION BY BarCode,BrandName,ItemName,Variant1,Variant2 ORDER BY ID ASC) AS RNo  from ( Select * from ( SELECT 0 ID,BarCode,BrandName,ItemName,Variant1,Variant2,SaleRate ,ROW_NUMBER() OVER (PARTITION BY BarCode,BrandName,ItemName,Variant1,Variant2 ORDER BY SaleRate DESC) AS RNumber FROM PurchaseBookSecondary )PBS Where RNumber=1 UNION ALL  Select 1 ID,Description BarCode,BrandName,ItemName,Variant1,Variant2,SaleRate,1 as RNumber  from ItemSecondary _IS  LEFT JOIN Items IM ON IM.BillCode=_IS.BillCode and IM.BillNo=_IS.BillNo and _IS.ActiveStatus = 1 and SaleRate>0 )Purch )PURCHASE WHERE RNo = 1  )SR ON SR.ItemName = Ins.ItemName AND ISNULL(SR.BarCode,'''') = ISNULL(Ins.BarCode,'''') AND ISNULL(SR.BrandName,'''') = ISNULL(Ins.BrandName,'''') AND SR.Variant1 = Ins.Variant1 AND SR.Variant2 = Ins.Variant2  INSERT INTO ItemStock (ItemName,BarCode,BrandName,Variant1,Variant2,Variant3,Variant4,Variant5,DesignName,Date ,StockQty,SaleRate,AvgRate,IsWithoutStock,CreatedBy,UpdatedBy,InsertStatus,UpdateStatus) SELECT I.ItemName,I.Barcode,I.BrandName,I.Variant1,I.Variant2,I.Variant3,I.Variant4,I.Variant5,I.DesignName,GETDATE() ,Qty=(CASE WHEN I.BillType IN (''OPENING'',''PURCHASE'',''STOCKIN'',''SALERETURN'') then I.Qty WHEN I.BillType IN (''SALES'', ''PURCHASERETURN'', ''STOCKOUT'') then -(I.Qty) else 0 end) ,SR.SaleRate,0 ,(CASE WHEN I.BillType = ''OPENING'' THEN (CASE WHEN (SELECT TOP 1 Other from Items IM WHERE IM.ItemName = I.ItemName)=''WITHOUT STOCK'' then 1 ELSE 0 end) ELSE 0 end) ,I.CreatedBy,'''',1,0 FROM inserted I LEFT JOIN ( SELECT * FROM ( Select ItemName,BarCode,BrandName,Variant1,Variant2,SaleRate,ROW_NUMBER() OVER (PARTITION BY BarCode,BrandName,ItemName,Variant1,Variant2 ORDER BY ID ASC) AS RNo  from ( Select * from ( SELECT 0 ID,BarCode,BrandName,ItemName,Variant1,Variant2,SaleRate ,ROW_NUMBER() OVER (PARTITION BY BarCode,BrandName,ItemName,Variant1,Variant2 ORDER BY SaleRate DESC) AS RNumber FROM PurchaseBookSecondary )PBS Where RNumber=1 UNION ALL  Select 1 ID,Description BarCode,BrandName,ItemName,Variant1,Variant2,SaleRate,1 as RNumber  from ItemSecondary _IS  LEFT JOIN Items IM ON IM.BillCode=_IS.BillCode and IM.BillNo=_IS.BillNo and _IS.ActiveStatus = 1 and SaleRate>0 )Purch )PURCHASE WHERE RNo = 1  )SR ON RNo = 1 AND SR.ItemName = I.ItemName  AND ISNULL(SR.BarCode,'''') = ISNULL(I.BarCode,'''') AND ISNULL(SR.BrandName,'''') = ISNULL(I.BrandName,'''')  AND SR.Variant1 = I.Variant1 AND SR.Variant2 = I.Variant2  WHERE (SELECT COUNT(*) FROM ItemStock ST WHERE ST.ItemName = I.ItemName AND ST.BarCode = I.BarCode AND ST.BrandName = I.BrandName AND ST.Variant1 = I.Variant1 AND ST.Variant2 = I.Variant2) = 0 END ELSE IF EXISTS (SELECT * FROM deleted) B