                strQuery = " CREATE PROCEDURE [dbo].[GetSaleOffer] (@BarCode_s varchar(250),@ItemName varchar(max),@BrandName varchar(250)) AS BEGIN Declare @ItemDate date,@Department varchar(250)='',@Category varchar(250)='',@P_Barcode varchar(250)=''; SELECT @Department = MakeName,@Category = Other FROM Items IM WHERE ItemName = @ItemName set @P_Barcode = SubString(@Barcode_s,0,CharIndex('.',@BarCode_s))SELECT @ItemDate = MAX([Date]) FROM StockMaster SM WHERE ItemName = @ItemName AND BillType IN ('OPENING','PURCHASE','SALERETURN','STOCKIN') IF OBJECT_ID('tempdb.dbo.#OfferTemp') IS NOT NULL DROP TABLE #OfferTemp SELECT * Into #OfferTemp from(SELECT  OM.OfferCode,OM.OfferNo,FilterType,STUFF((SELECT ',' + FiletrValue FROM OfferDetails OD WHERE OD.OfferCode = OM.OfferCode AND OD.OfferNo = OM.OfferNo AND FilterName = 'DEPARTMENT' FOR XML PATH('')),1,1,'') DEPARTMENT ,STUFF((SELECT ',' + FiletrValue FROM OfferDetails OD WHERE OD.OfferCode = OM.OfferCode AND OD.OfferNo = OM.OfferNo AND FilterName = 'BRAND' FOR XML PATH('')),1,1,'') BRAND,STUFF((SELECT ',' + FiletrValue FROM OfferDetails OD WHERE OD.OfferCode = OM.OfferCode AND OD.OfferNo = OM.OfferNo AND FilterName = 'CATEGORY' FOR XML PATH('')),1,1,'') CATEGORY,STUFF((SELECT ',' + FiletrValue FROM OfferDetails OD  WHERE OD.OfferCode = OM.OfferCode AND OD.OfferNo = OM.OfferNo AND FilterName = 'ITEM' FOR XML PATH('')),1,1,'') ITEM,STUFF((SELECT ',' + FiletrValue FROM OfferDetails OD WHERE OD.OfferCode = OM.OfferCode AND OD.OfferNo = OM.OfferNo AND FilterName = 'BARCODE' FOR XML PATH('')),1,1,'') BARCODE FROM OfferDetails OM GROUP BY OM.OfferCode,OM.OfferNo,FilterType)Final SELECT OM.OFFER_CODE OfferCode,OM.OFFER_NO OfferNo, OM.OFFER_NAME OfferName,OM.OFFER_DESC OfferDesc,OM.REWARD_COUPON RewardCoupan ,Cast(OM.ITEM_ARRIVAL_DATE_FROM as DATE) ArvFDate,Cast(OM.ITEM_ARRIVAL_DATE_TO as DATE) ArvToDate ,Convert(Varchar(12),OM.OFFER_VALID_FROM ,103) OffValidFrom ,Convert(Varchar(12),DateAdd(dd,1,OM.OFFER_VALID_TILL),103) OffValidTo ,OM.FREE_QTY FreeQty,OM.QUANTITY PurQty,OM.DISC_TYPE DiscType,OM.Discount DiscAmt,OM.AMOUNT_FROM MinPurAmt,OM.AMOUNT_TO MaxPurAmt,OM.IsAddOn , OM.OfferAmount FixOfferAmt,OM.FREE_PER FreePer,OM.FREE_MIN_AMT MinPayAmt,(STUFF((SELECT ',' + FiletrValue FROM OfferDetails OD WHERE FilterType = 'GET' AND OD.OfferCode = OT.OfferCode AND OD.OfferNo = OT.OfferNo AND FilterName = 'BARCODE' FOR XML PATH('')),1,1,'')) FreeBarCodes FROM #OfferTemp OT LEFT JOIN OFFER_MASTER OM ON OT.OfferCode = OM.OFFER_CODE  AND OT.OfferNo = OM.OFFER_NO WHERE OT.FilterType = 'BUY' AND OM.IsCoupan != 1 AND @Department IN (SELECT Item FROM SplitString(OT.DEPARTMENT,',')) AND @BrandName IN (SELECT Item FROM SplitString(OT.BRAND,',')) AND @Category IN (SELECT Item FROM SplitString(OT.CATEGORY,',')) AND @ItemName IN (SELECT Item FROM SplitString(OT.ITEM,',')) AND @BarCode_s IN (SELECT Item FROM SplitString(OT.BARCODE,',')) AND (CASE WHEN OM.ITEM_ARRIVAL_DATE_FROM < '2001-01-01' then 1 when Cast(@ItemDate as smalldatetime) >= OM.ITEM_ARRIVAL_DATE_FROM then 1 else 0 end)= 1 AND (CASE WHEN OM.ITEM_ARRIVAL_DATE_TO < '2001-01-01' then 1 when Cast(@ItemDate as smalldatetime) < OM.ITEM_ARRIVAL_DATE_TO then 1 else 0 end)= 1 ORDER BY OM.OFFER_VALID_FROM,OM.OFFER_NAME END ";
